import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import { useDataRequestContext } from './data_reqeust_context';

const DataConsumerPanel: React.FC = () => {
  const navigate = useNavigate();
  const { dataRequests, addDataRequest } = useDataRequestContext();
  const [min, setMin] = useState<number | ''>('');
  const [max, setMax] = useState<number | ''>('');

  const handleSubmit = async () => {
    if (min === '' || max === '') {
        alert('enter both values')
        return
    }
    if (min >= max) {
        alert('max must be greater than min')
        return
    }
    try {
      const response = await fetch(
        'http://localhost:3001/data-request', 
        { 
            method: 'POST',
            headers: {
              'Content-Type': 'application/json'
            },
            body: JSON.stringify({ 
                user_id: 'dc123',
                data_type: 'blood_pressure',
                min, 
                max,
                leq: true,
                geq: true
            })
        }
      )
      const data = await response.json()
      const { id, exp_date } = data
      const newItem = await fetch(`http://localhost:3001/data-request/${id}`).then(res => res.json());
      console.log(newItem)
      addDataRequest(newItem);
      alert(`data request created\nid: ${id}\nexp_date: ${exp_date}`)
      setMin('')
      setMax('')
      return
    } catch (err) {
      console.error(err)
    }
  };

  return (
    <div style={{ textAlign: 'center', marginTop: '100px' }}>
      <div style={{ position: 'absolute', top: '20px', left: '20px' }}>
        <button
          onClick={() => navigate('/')}
          style={{
            padding: '6px 12px',
            borderRadius: '4px',
            fontSize: '14px',
            backgroundColor: '#ccc',
            border: 'none',
            cursor: 'pointer'
          }}
        >
          ‚Üê Back
        </button>
      </div>
      <h2>Data Consumer</h2>
      <h4>data type: blood_pressure</h4>
      <div style={{ marginTop: '20px' }}>
        <div style={{ margin: '10px' }}>
          <label>min: </label>
          <input
            type="number"
            value={min}
            onChange={(e) => setMin(Number(e.target.value))}
          />
        </div>
        <div style={{ margin: '10px' }}>
          <label>max: </label>
          <input
            type="number"
            value={max}
            onChange={(e) => setMax(Number(e.target.value))}
          />
        </div>
        <button
          onClick={handleSubmit}
          style={{
            marginTop: '20px',
            padding: '8px 16px',
            borderRadius: '6px',
            fontSize: '14px',
            backgroundColor: '#1976d2',
            color: 'white',
            border: 'none',
            cursor: 'pointer'
          }}
        >
          Submit
        </button>
      </div>
      <ul style={{ marginTop: '40px', listStyle: 'none', padding: 0 }}>
        {dataRequests.map((item) => (
          <li key={item.id} style={{ margin: '10px 0', border: '1px solid #ccc', padding: '10px', borderRadius: '6px' }}>
            <div><strong>ID:</strong> {item.id}</div>
            <div><strong>Min:</strong> {item.min}</div>
            <div><strong>Max:</strong> {item.max}</div>
            <div><strong>Exp:</strong> {new Date(item.exp_date).toLocaleString()}</div>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default DataConsumerPanel;
